eceptions (13) to wide receivers this season.\",\"title\":\"TD streak comes to end\"},{\"timeEpochMilli\":\"1605713927000\",\"contents\":\"Arizona Cardinals wide receiver Christian Kirk had a quiet game in Week 10 against the Buffalo Bills, catching four passes for just 27 yards. This week, Kirk and the Cardinals face the Seattle Seahawks, who have the league's worst pass defense. Kirk caught five passes for 38 yards and two touchdowns over eight targets the last time the two teams played in Week 7. Expect more yardage from Kirk this time around. He should be able to manage around 70 yards or more with a good chance to score. ...\",\"url\":\"https://www.rotoballer.com/player-news/christian-kirk-should-bounce-back-in-week-11/805403\",\"title\":\"Christian Kirk Should Bounce Back In Week 11\"}],\"nameFirst\":\"Christian\",\"nameLast\":\"Kirk\",\"hasLockedPremiumContent\":true,\"proTeam\":{\"abbreviation\":\"ARI\",\"location\":\"Arizona\",\"name\":\"Cardinals\"},\"externalIds\":[{\"id\":\"ebcd87ce-218c-4144-810b-921c2f59d6e8\"}],\"positionEligibility\":[\"WR\"]},\"requestedGames\":[{\"game\":{\"id\":6299,\"away\":{\"abbreviation\":\"ARI\",\"location\":\"Arizona\",\"name\":\"Cardinals\"},\"home\":{\"abbreviation\":\"SEA\",\"location\":\"Seattle\",\"name\":\"Seahawks\"},\"startTimeEpochMilli\":\"1605835200000\",\"period\":{\"ordinal\":11,\"startEpochMilli\":\"1605610800000\",\"isNow\":true}},\"stats\":[{\"category\":{\"id\":175,\"abbreviation\":\"Rec\",\"nameSingular\":\"Target % Caught\",\"namePlural\":\"Target % Caught\"}},{\"category\":{\"id\":42,\"abbreviation\":\"Yd\",\"nameSingular\":\"Receiving Yard\",\"namePlural\":\"Receiving Yards\"}},{\"category\":{\"id\":26,\"abbreviation\":\"Fum\",\"nameSingular\":\"Fumble\",\"namePlural\":\"Fumbles\",\"lowerIsBetter\":true}},{\"category\":{\"id\":29,\"abbreviation\":\"TD\",\"nameSingular\":\"Offensive + Special Teams TD\",\"namePlural\":\"Offensive + Special Teams TDs\"}}],\"statsProjected\":[{\"category\":{\"id\":175,\"abb